import React from 'react';
import '../styles.css';

const SalonInfo = () => {
  return (
    <div className="container">
      <section className="content-section">
        <h2>Pronájem salonku</h2>
        <p>
          Rodinná oslava, firemní akce, třídní srazy, výroční schůze spolků nebo sportovních klubů, to vše můžete udělat v našem
          salonku, který má kapacitu 50 osob. Občerstvení vám rádi připravíme podle dohody.
        </p>
        <p>
          Pro bližší informace a rezervace volejte **777 611 601**.
        </p>
      </section>
    </div>
  );
};

export default SalonInfo;
